.
🐇Lagomorfos são pequenos mamíferos, herbívoros e que são representados principalmente pelos coelhos e lebres.
.
🐀Já os roedores, constituem a maior ordem de mamíferos, composta por mais de 2000 espécies. Entre eles estão o rato, esquilo, porquinho da Índia, chinchila, capivara, entre outros.
.
🦷É na dentição que está a principal similaridade e também onde conseguimos diferenciar as duas ordens. Pelo fato de possuirem crescimento contínuo da dentição, tanto os roedores como os lagomorfos, necessitam roer para que haja o desgaste desses dentes, e por isso muitas vezes os coelhos e lebres são confundidos com roedores.
.
🐰Além disso os lagomorfos possuem 4 dentes incivisos superiores sem espaçamento (diastema), enquanto os roedores possuem apenas 2 incisivos superiores e com espaçamento. Ambos possuem 2 incivisos inferiores com espaçamento. No total os lagomorfos possuem 28 dentes e os roedores 22 dentes.
.
🐭Outras diferenças que podem ser observadas: nos lagomorfos, os testículos dos machos estão à frente do pênis, enquanto nos roedores é o inverso; os machos de lagomorfos não possuem osso peniano que está presente nos roedores; lagomorfos são estritamente herbívoros, enquanto os roedores possuem hábitos alimentares variadissimos e na maioria omnivoros.
.
.
.
